    <text

       id="text52"><tspan
         
         y="0"
         id="tspan40">Lille legeplads på campingpladsen med bl.a. rutsje-</tspan><tspan

         id="tspan42">bane, balancebom, gynger og sand-kasse. toilet findes </tspan><tspan

         y="50.388"
         id="tspan48">er gode turmuligheder til bl.a. Grønhøj Jættestue og </tspan><tspan
         
         y="62.985001"
         id="tspan50">Lovby kirketomt.</tspan></text>
    <text

       id="text76"><tspan

         id="tspan58">stort legeområde indrettet i del af parken. Gynger, </tspan><tspan

         id="tspan60">vippe, svævebane, shelter, bøgelabyrint, “amfi-teater”, </tspan><tspan
         
         y="25.194"
         id="tspan62">bålplads, sandkasse, borde/bænke og meget mere. nye-</tspan><tspan
         
         y="37.791"
         id="tspan64">ste tiltag er en motionsslange, hvor du kan få styrket </tspan><tspan
         
         y="50.388"
         id="tspan66">musklerne og balancen. toilet findes bag stilleplads. </tspan><tspan
         
         y="62.985001"
         id="tspan68">Åbent i sommerhalvåret i dagtimerne. søer med ænder </tspan><tspan
         
         y="75.582001"
         id="tspan70">og broer. “slangebjerg” med rester af Erik Menveds </tspan><tspan
         
         y="88.179001"
         id="tspan72">Borg. smuk landskabelig park med mange gamle træer. </tspan><tspan
         
         y="100.776"
         id="tspan74">tæt forbindelse til banegård og midtbyen. </tspan></text>

       id="text168"><tspan
         
         y="0"
         id="tspan164">Lille legeplads på grønt område på lystbådehavnen. </tspan><tspan
         
         y="12.597"
         id="tspan166">toilet forefindes og er åbent hele året.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,685.9908)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text172"><tspan
         
         y="0"
         id="tspan170">aktivplads på havnen ved Havnesporet: </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,523.82115,685.9908)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text186"><tspan
         
         y="0"
         id="tspan174">solbeskinnet </tspan><tspan
         
         y="12.597"
         id="tspan176">opholdsplads vest for lystbådehavnen med borde- </tspan><tspan
         
         y="25.194"
         id="tspan178">bænke og områder til boldspil, pannabane, beachhånd-</tspan><tspan
         
         y="37.791"
         id="tspan180">bold og basket. Her er også store skulpturelle sten, </tspan><tspan
         
         y="50.388"
         id="tspan182">som man kan tage fat om på vej fra lystbådehavnen til </tspan><tspan
         
         y="62.985001"
         id="tspan184">centrum.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,597.8023)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text190"><tspan

         id="tspan188">Husodde</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,585.2053)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text196"><tspan
         
         y="0"
         id="tspan192">Lille legeplads med gynger på strandområdet foran </tspan><tspan
         
         y="12.597"
         id="tspan194">Husodde Campingplads. </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,547.4048)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text200"><tspan
         
         y="0"
         id="tspan198">Grusdalsvej, egebjerg</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,534.8078)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text206"><tspan
         
         y="0"
         id="tspan202">Lille legeplads for småbørn med gode opholdsmulig-</tspan><tspan
         
         y="12.597"
         id="tspan204">heder. </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,497.0073)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text210"><tspan
         
         y="0"
         id="tspan208">P. C. Jensensvej, Hovedgård</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,484.4103)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text218"><tspan
         
         y="0"
         id="tspan212">ny og solid legeplads med karrusel, klatrestativ, stor </tspan><tspan
         
         y="12.597"
         id="tspan214">sandkasse, bålplads, plads til boldspil og hyggelig skov </tspan><tspan
         
         y="25.194"
         id="tspan216">bagved. </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,434.0128)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text222"><tspan
         
         y="0"
         id="tspan220">Legeplads i parken i Brædstrup </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,421.4158)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text244"><tspan
         
         y="0"
         id="tspan224">i parken i Brædstrup er der leg for både store og små. </tspan><tspan
         
         y="12.597"
         id="tspan226">En sandkasse med legehuse og balanceline, edderkop-</tspan><tspan
         
         y="25.194"
         id="tspan228">perutsjebane ved tennisbanerne samt balanceredskab </tspan><tspan
         
         y="37.791"
         id="tspan230">og hængekøje. </tspan><tspan
         
         y="50.388"
         id="tspan232">For de lidt ældre er der et motionsredskab i den nord-</tspan><tspan
         
         y="62.985001"
         id="tspan234">lige del af parken, når man passerer forbi på sin gå- </tspan><tspan
         
         y="75.582001"
         id="tspan236">eller løbetur. Legeredskaberne er fordelt på 3-4 steder </tspan><tspan
         
         y="88.179001"
         id="tspan238">i parken, som danner en hyggelig ramme til leg og </tspan><tspan
         
         y="100.776"
         id="tspan240">motion med sine mange gamle træer, stier og grønne </tspan><tspan
         
         y="113.373"
         id="tspan242">plæner.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,282.8393)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text248"><tspan
         
         y="0"
         id="tspan246">Østbirk Legeplads</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,270.2423)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text256"><tspan
         
         y="0"
         id="tspan250">Legeplads med gynger, rutsjebane og sandkasse. Lege-</tspan><tspan
         
         y="12.597"
         id="tspan252">pladsen ligger ved naturstien Horsens-silkeborg og </tspan><tspan
         
         y="25.194"
         id="tspan254">bliver vedligeholdt af Borgerforeningen.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,219.8448)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text260"><tspan
         
         y="0"
         id="tspan258">Legeplads ved Slotsskolen</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5817,207.2478)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text282"><tspan
         
         y="0"
         id="tspan262">stor ny dejlig legeplads/motionsområde til slotsskolen </tspan><tspan
         
         y="12.597"
         id="tspan264">med klatreredskaber, gynger, motionsredskaber og </tspan><tspan
         
         y="25.194"
         id="tspan266">store, åbne grønne områder i let kuperet terræn med </tspan><tspan
         
         y="37.791"
         id="tspan268">plads til boldspil og fysisk udfoldelse.</tspan><tspan
         
         y="50.388"
         id="tspan270">Legepladsen er åben for offentligheden uden for sko-</tspan><tspan
         
         y="62.985001"
         id="tspan272">lens åbningstid. i skoletiden er området primært bereg-</tspan><tspan
         
         y="75.582001"
         id="tspan274">net for skolens elever. Legepladsen er planlagt som </tspan><tspan
         
         y="88.179001"
         id="tspan276">et friareal for skolen og som en kvarterslegeplads for </tspan><tspan
         
         y="100.776"
         id="tspan278">Vestbyens borgere, og der er adgang fra Fussingsvej og </tspan><tspan
         
         y="113.373"
         id="tspan280">Hede nielsens Vej.</tspan></text>
